import React from "react";
import { ITask } from "../Interfaces/ITask";

interface Props {
    task: ITask;
}

const TodoTask = ({task}: Props) => {
    return (
        <div>
        <div className="task-header">
                <h3>ID</h3>
                <h3>TITLE</h3>
                <h3>DESCRIPTION</h3>
                <h3>STATUS</h3>
            </div>
        <div className="task">

            <div className="content">
                <span>{task.title}</span>
                <span>{task.description}</span>
                <input type="checkbox" />
            </div>

        </div>
        </div>
    )

}

export default TodoTask
